import './addNewRoom.css';
import { useState } from 'react';
import CreateRoom from '../../Components/creatingroom/CreateRoom';
import BlankForm from '../../Components/form/BlankForm';
import SecButton from '../../buttons/SecButton';
import ThirdButton from '../buttons/ThirdButton';

const AddNewRoom = (props) => {

    const [screen, setScreen] = useState(true);

    function handleClickAddNewRoom() {
      setScreen(false);
      console.log(screen)
    }

    if (screen === true) {
      return (
        <div className="add-new-room" >
          <div className="bg-new-room" onClick={handleClickAddNewRoom}></div>
          <div className="create-room-screen">
            <div className="create-room-bg"></div>
            <div className="create-room-container">
                <div className="title-screen">Crie uma sala</div>
                <BlankForm 
                    titleform="nome da sala" 
                    nameinput="nome da sala" 
                    placeholderform="Dê um nome para a sala"
                    idform="room-name">
                </BlankForm>
                <BlankForm 
                    titleform="url do vídeo" 
                    nameinput="url do vídeo" 
                    placeholderform="Cole aqui a url do link do vídeo"
                    idform="room-url">
                </BlankForm>
                <div className="create-room-buttons">
                    <ThirdButton onClick={props.test}>cancelar</ThirdButton>
                    <SecButton>confirmar</SecButton>
                </div>
            </div>
        </div>   
        
        </div>      
      )
    }    
};

export default AddNewRoom;
